    false,nt"url": null,nt"notes": "This report presents the"results of the
    California Division of Mines and Geology's(COM G) geothermal resource investigation
    of the Paso Robles area, California. The study was undertaken to learn more about
    the known geothermal resource In this area and to assess the potential of the resource
    for development and use by the local community. The project was conducted in compliance
    with the terms of the fourth-year contract (1981-82)with the U.S. Department of
    Energy (DOE) under the state-coupled program and performed under CDMG's Phase II
    site-specific geothermal resources studies program.",nt"license_title": null,nt"extras":
